import React, { useState } from 'react';

const StuManageAddPage = () => {
  const [userName, setUserName] = useState('');
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [course, setCourse] = useState('');
  const [batch, setBatch] = useState('');
  const [year, setYear] = useState('');
  const [semester, setSemester] = useState('');

  const handleSubmit = () => {
    // Your logic to handle form submission goes here
    // You can access all the form values from the state variables
    // For example: userName, email, password, etc.
    console.log('Form submitted!');
  };

  const handleCancel = () => {
    // Your logic to handle form cancel goes here
    // For example: clear the input fields or navigate back
    console.log('Form canceled!');
  };

  return (
    <div>
      <div>
        <label>User Name:</label>
        <input type="text" value={userName} onChange={(e) => setUserName(e.target.value)} />
      </div>
      <div>
        <label>Email:</label>
        <input type="email" value={email} onChange={(e) => setEmail(e.target.value)} />
      </div>
      <div>
        <label>Password:</label>
        <input type="password" value={password} onChange={(e) => setPassword(e.target.value)} />
      </div>
      <div>
        <label>Course:</label>
        <input type="text" value={course} onChange={(e) => setCourse(e.target.value)} />
      </div>
      <div>
        <label>Batch:</label>
        <input type="text" value={batch} onChange={(e) => setBatch(e.target.value)} />
      </div>
      <div>
        <label>Year:</label>
        <input type="text" value={year} onChange={(e) => setYear(e.target.value)} />
      </div>
      <div>
        <label>Semester:</label>
        <input type="text" value={semester} onChange={(e) => setSemester(e.target.value)} />
      </div>

      <div>
        <button onClick={handleCancel}>Cancel</button>
        <button onClick={handleSubmit}>Submit</button>
      </div>
    </div>
  );
};

export default StuManageAddPage;
